var Particle = function (x, y, size, xSpeed, ySpeed) {
    this.x = x;
    this.y = y;
    this.size = typeof size === 'undefined' ? Math.floor(Math.random() * 10) : size;
    this.xSpeed = typeof xSpeed === 'undefined' ? Math.floor(Math.random() * 10) - 5 : xSpeed;
    this.ySpeed = typeof ySpeed === 'undefined' ? Math.floor(Math.random() * 10) - 5 : ySpeed;
    this.maxLifetime = 1000;
    this.lifetime = this.maxLifetime;
    this.rgb = [255, 255, 255];
    this.degrees = 0;
};

var DuckSystem = function () {
    this.context = null;
    this.canvas = null;
    this.started = false;
    this.particles = [];
    this.interval = null;
    this.spawnDuck = 0;
    this.degrees = 0;
    this.duck = document.createElement('img');
    this.duck.src = 'data:image/png;base64,';
};

DuckSystem.prototype.clear = function () {
    this.context.clearRect(0, 0, this.canvas.width * 2, this.canvas.height * 2);
};

DuckSystem.prototype.start = function () {
    
    let body = document.getElementsByTagName('body')[0];
    let width = window.innerWidth || document.documentElement.clientWidth || body.clientWidth || 0;
    let height = window.innerHeight || document.documentElement.clientHeight || body.clientHeight || 0;

    if (!width || !height) {
        return false;
    }

    body.style.padding = body.style.margin = '0';
    body.style.overflow = 'hidden';
    body.style.backgroundColor = 'black';

    let old = document.getElementById('particles');
    if (old !== null) old.parentNode.removeChild(old);

    this.canvas = document.createElement("canvas");
    this.canvas.style.zIndex = 99999;
    this.canvas.setAttribute('id', 'particles');
    this.context = this.canvas.getContext("2d");
    this.context.globalCompositeOperation = 'lighter';
    this.canvas.width = width;
    this.canvas.height = height;
    this.canvas.style.position = "fixed";
    this.canvas.style.top = "0px";
    this.canvas.style.opacity = "0.8";
    this.canvas.style.pointerEvents = "none";
    body.appendChild(this.canvas);
    this.started = true;
    clearInterval(this.interval);
    this.interval = setInterval(this.update.bind(this), 25);
    window.requestAnimationFrame(this.renderFrame.bind(this));
};

DuckSystem.prototype.stop = function () {
    this.started = false;
    clearInterval(this.interval);
};

DuckSystem.prototype.getColour = function () {

    let r = Math.floor(Math.random() * 255);
    let g = Math.floor(Math.random() * 255);
    let b = Math.floor(Math.random() * 255);

    switch(Math.floor(Math.random() * 5)){
        case 0: // green
            return this.roughRGB(90, 193, 97);
        case 1: // orange
            return this.roughRGB(255, 102, 0);
        case 2: // yellow
            return this.roughRGB(236, 208, 50);
        case 3: // brown
            return this.roughRGB(159, 104, 74);
        case 4: // grey
            return this.roughRGB(190, 177, 164);
    }

};

DuckSystem.prototype.roughColour = function(orig) {
    let region = 40;
    orig = orig - (region/2);
    if (orig < 0) {
        region = region + (orig*2)
        orig = 0
    }
    return orig + Math.floor(Math.random() * region);
};

DuckSystem.prototype.roughRGB = function(r,g,b) {
    return [this.roughColour(r), this.roughColour(g), this.roughColour(b)];
};

DuckSystem.prototype.update = function () {

    let particleAddCount = 4;

    this.spawnDuck = !this.spawnDuck;

    if(this.spawnDuck){
        this.particles.push(this.createParticle(true));
    }else{
        for (let i = 0; i < particleAddCount; i++) {
            this.particles.push(this.createParticle(false));
        }
    }


    let end = this.particles.length -1;
    for (let i = end; i >= 0; i--) {
        if (--this.particles[i].lifetime <= 0) {
            this.particles[i] = null;
            this.particles.splice(i, 1);
            continue;
        }
        let particle = this.particles[i];
        particle.degrees = (particle.degrees+1) % 360;
        particle.size *= 0.99;
        particle.x = particle.x + particle.xSpeed;
        particle.y = particle.y + particle.ySpeed;
        particle.lifetime--;
        this.particles[i] = particle;
    }

    this.degrees = (this.degrees + 0.5) % 360;
};

DuckSystem.prototype.createParticle = function (isDuck) {
    
    let w = 0;
    let h = 0;

    switch (Math.floor(Math.random() * 5)) {
        case 3:
            w = 4;
            h = 2;
            break;
        case 2:
            w = 2;
            h = 4;
            break;
        case 1:
            w = 4;
            h = 4;
            break;
        default:
            w = 2;
            h = 2;
            break;
    }

    let scale = isDuck ? 10 : 30; // ducks be big
    let size = Math.floor(Math.random() * Math.floor(Math.max(this.canvas.width, this.canvas.height) / scale))
    let particle = new Particle(Math.floor(this.canvas.width / w), Math.floor(this.canvas.height / h), size);
    particle.rgb = this.getColour();
    particle.isDuck = isDuck;
    particle.degrees = Math.floor(Math.random() * 360);

    return particle;
}

DuckSystem.prototype.drawParticle = function (particle) {
    this.context.beginPath();
    this.context.globalAlpha = particle.lifetime / particle.maxLifetime;
    this.context.fillStyle = "rgb(" + particle.rgb.join(',') + ')';
    this.context.arc(particle.x, particle.y, particle.size, 0, Math.PI * 2, true);
    this.context.closePath();
    this.context.fill();
};

DuckSystem.prototype.drawDuck = function (particle) {
    let radians = particle.degrees * Math.PI / 180;
    this.context.globalAlpha = particle.lifetime / particle.maxLifetime;
    this.context.translate(particle.x, particle.y);
    this.context.rotate(radians);
    this.context.drawImage(this.duck,  -particle.size,  -particle.size, particle.size * 2, particle.size * 2);
    this.context.rotate(-radians);
    this.context.translate(-particle.x, -particle.y);
};

DuckSystem.prototype.renderFrame = function () {

    this.clear();

    this.context.save();

    this.context.globalCompositeOperation = 'hue';
    this.context.translate(this.canvas.width / 2, this.canvas.height / 2);
    this.context.rotate(this.degrees * Math.PI / 180);
    this.context.translate(-this.canvas.width / 2, -this.canvas.height / 2);

    for (let i = 0; i < this.particles.length; i++) {
        if(this.particles[i].isDuck) {
            this.drawDuck(this.particles[i]);
        }
    }
    for (let i = 0; i < this.particles.length; i++) {
        if(!this.particles[i].isDuck) {
            this.drawParticle(this.particles[i]);
        }
    }

    this.context.restore();

    if (this.started) {
        window.requestAnimationFrame(this.renderFrame.bind(this));
    }
};

function ducks() {
    var duck = new DuckSystem();
    duck.start();
    window.addEventListener('resize', function () {
        if(duck.started){
            duck.stop();
            duck.start();
        }
    });
}

if (document. readyState === 'complete') { 
    ducks();
}

document.addEventListener("DOMContentLoaded", ducks);
